import React from 'react';
import ReactDOM from 'react-dom';

class Nav extends React.Component {
    links = [
        {
            text: "<Home />",
            url: "http://localhost:3000/",
            color: "green"
        },
        {
            text: "About",
            url: "http://localhost:3000/",
            color: "white"
        },
        {
            text: "Contact",
            url: "http://localhost:3000/",
            color: "white"
        }
    ]

    listLinks = this.links.map((link) =>
            <li><a href={link.url} className={link.color}>{link.text}</a></li>
    );

    render() {
        return (
            <nav className="portfolio-nav">
                <div className="logo">George Kilburg</div>
                <div className="nav-links">
                    <ul>
                        {this.listLinks}
                    </ul>
                </div>
            </nav>
        );
    }
}

ReactDOM.render(<Nav />, document.getElementById('root'))
export default Nav;
